/*Table structure for table `system_setting` */

DROP TABLE IF EXISTS `system_setting`;

CREATE TABLE `system_setting` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `bonus_rule` decimal(11,3) DEFAULT NULL COMMENT '奖金的阶级',
  `per_money` decimal(11,3) DEFAULT NULL COMMENT '一次奖励多少',
  `star_time` int(2) DEFAULT NULL COMMENT '开始发单时间',
  `per_total` decimal(11,3) DEFAULT NULL COMMENT '每次发的总金额',
  `minManey` decimal(11,3) DEFAULT NULL COMMENT '每个红包的最小金额',
  `maxManey` decimal(11,3) DEFAULT NULL COMMENT '每个红包的最大金额',
  `how_many` int(5) DEFAULT NULL COMMENT '每次发多少个',
  `end_time` int(2) DEFAULT NULL COMMENT '停止发单时间',
  `how_long` int(11) DEFAULT NULL COMMENT '每隔多久发一次',
  `bunus_money` decimal(11,3) DEFAULT NULL COMMENT '单次佣金',
  `full_money` decimal(11,3) DEFAULT NULL COMMENT '满多少金额以后,金额增加到冻结金额',
  `sons` int(11) DEFAULT NULL COMMENT '下线数量',
  `text_rules` text COMMENT '游戏规则说明',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=2 DEFAULT CHARSET=utf8;

/*Data for the table `system_setting` */

insert  into `system_setting`(`id`,`bonus_rule`,`per_money`,`star_time`,`per_total`,`minManey`,`maxManey`,`how_many`,`end_time`,`how_long`,`bunus_money`,`full_money`,`sons`,`text_rules`) values (1,'100000.000','100.000',0,'50000.000','500.000','2000.000',70,24,300,'0.006','20000.000',5,'1:如何获取虚拟体验金：用户可通过参与系统每5分钟发放的体验金领取获取。\n2:体验金的使用期限：用户获得体验金累计订单20000元，须在2小时内转入系统账户,到期后未转入系统账户检验金自动作废。\n3:虚拟体验金收益：体验金奖励金比例0.006完成任务系统自动转入用户账户。\n4:虚拟体验金收益发放：领取体验金活动24小时开放。\n5:团队收益奖励计算规则：团队基准为5人，无上限、团队24小时领取体验金10万奖励100元，20万奖励200元、以此类推，团队奖励24小时内发放。\n6:星级团队24小时收益奖励计算规则：\n一星100万 团队24小时领取体验金100万奖励1150+1000。\n二星200万 团队24小时领取体验金200万奖励2300+2000。\n三星300万 团队24小时领取体验金300万奖励4600+3000。\n7:虚拟金提现时间段为早上9：00到晚上22：00,到账时间为24小时之内,节假日可能会有延时。\n8:客户订单数据只统计单日的。');

